const SearchContent = () => {

  <div className="text-center hero my-5">

  <input placeholder="Enter Post Title"/>

    <p className="lead">
      Will add a search bar
    </p>
    <p className="next line">
      Will add plants that you can select to add and get information on
    </p>

  </div>
};

export default SearchContent;
